import React from 'react';
import { Typography } from '@material-ui/core';

const UserDashboard = () => {
  return (
    <>
      <Typography variant="h6" gutterBottom>
        User Dashboard
      </Typography>
      {/* Add user dashboard content here */}
    </>
  );
};

export default UserDashboard;
